import React, { useState } from 'react';

import ApiService from '../../services/api';

const TenantLoginForm = ({ property, onLoginSuccess }) => {
    const [formData, setFormData] = useState({
        email: '',
        password: ''
    });
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
        // Clear error when user starts typing
        if (error) setError('');
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError('');

        try {
      const data = await ApiService.portalTenantLogin(formData);
      onLoginSuccess(data);
        } catch (error) {
            console.error('Login error:', error);
            setError('Network error. Please check your connection and try again.');
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="bg-white rounded-xl shadow-lg p-6">
            <div className="mb-6">
                <h3 className="text-2xl font-bold text-gray-900 mb-2">
                    Tenant Login
                </h3>
                <p className="text-gray-600">
                    Access your tenant dashboard for <strong>{property.title}</strong>
                </p>
            </div>

            {error && (
                <div className="mb-4 p-4 bg-red-50 border border-red-200 rounded-lg">
                    <div className="flex items-center">
                        <div className="text-red-400 mr-3">⚠️</div>
                        <div className="text-red-800 text-sm">{error}</div>
                    </div>
                </div>
            )}

            <form onSubmit={handleSubmit} className="space-y-4">
                <div>
                    <label htmlFor="email" className="block text-sm font-medium text-gray-700 mb-2">
                        Email Address
                    </label>
                    <input
                        type="email"
                        id="email"
                        name="email"
                        value={formData.email}
                        onChange={handleChange}
                        required
                        className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition-colors"
                        placeholder="Enter your email"
                        disabled={loading}
                    />
                </div>

                <div>
                    <label htmlFor="password" className="block text-sm font-medium text-gray-700 mb-2">
                        Password
                    </label>
                    <input
                        type="password"
                        id="password"
                        name="password"
                        value={formData.password}
                        onChange={handleChange}
                        required
                        className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition-colors"
                        placeholder="Enter your password"
                        disabled={loading}
                    />
                </div>

                <button
                    type="submit"
                    disabled={loading}
                    className={`w-full py-3 px-4 rounded-lg font-medium transition-colors ${
                        loading
                            ? 'bg-gray-400 cursor-not-allowed'
                            : 'bg-blue-600 hover:bg-blue-700'
                    } text-white`}
                >
                    {loading ? (
                        <div className="flex items-center justify-center">
                            <div className="animate-spin rounded-full h-5 w-5 border-b-2 border-white mr-2"></div>
                            Logging in...
                        </div>
                    ) : (
                        'Login to Tenant Dashboard'
                    )}
                </button>
            </form>

            <div className="mt-6 pt-6 border-t border-gray-200">
                <div className="text-center">
                    <p className="text-sm text-gray-600 mb-3">
                        Don't have a tenant account?
                    </p>
                    <div className="bg-blue-50 rounded-lg p-4">
                        <p className="text-sm text-blue-800 mb-2">
                            <strong>For Test Purposes:</strong>
                        </p>
                        <div className="text-xs text-blue-700 space-y-1">
                            <div>Email: <code className="bg-blue-100 px-1 rounded">tenant@example.com</code></div>
                            <div>Password: <code className="bg-blue-100 px-1 rounded">Tenant123!</code></div>
                        </div>
                    </div>
                </div>
            </div>

            <div className="mt-4 text-center">
                <p className="text-xs text-gray-500">
                    This is a property-specific login portal for {property.title}
                </p>
            </div>
        </div>
    );
};

export default TenantLoginForm;
